import React from 'react'; 
import './GamesList.css';


const GamesList = ({games, closePopup}) => {

	let regex = /\[White\s"?(.*?)"?\]/;
	let text  = games[0];

	alert(text.match(regex));

	return (
		<div className='list-container'>
			<h1>Select game:</h1>
			<div className="games-container">
				{ 
					games.map((i, c) => {
						return <div key={c+'game'} onClick={() => closePopup(i)} className="game">{i}</div>;
					})
				}
			</div>
		</div>
		);
}
export default GamesList;
